export default function Description() {
  return(
    <div className="descript">
      <p id="pc">
        デジタルデザイナー兼デベロッパーを目指し日々勉強中です。<br/>
        幼少期にドイツのミュンヘンに２年間住んでおり、ヨーロッパ諸国の街や人、物に関り海外のデザインや考え方に触れました。
        高校生のころからダンスをはじめ、大学のサークルもダンスをしてました。
        社会に出てからは、
      </p>
      <p id="phone">
      携帯
      </p>
    </div>
  );
}
